import React from "react";
import Navigation from './navigation';
import '../css/main.css';
import AboutCard from './AboutCard';

function About(){
    return(
        <div>
            <Navigation/>
            <h1>About Lucas</h1>
            <AboutCard/>
        </div>
    );
}

export default About;
